"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Developmental dysplasia of the hip (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/developmental-dysplasia-of-the-hip-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H265788860\">",
"      <span class=\"h1\">",
"       What is developmental dysplasia of the hip?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Developmental dysplasia of the hip is a condition that causes hip joint problems, mostly in babies and children. The hip joint is a &ldquo;ball and socket&rdquo; joint. It&rsquo;s called that because the top of the thigh bone is ball-shaped and fits into part of the pelvic bone (",
"      <a class=\"graphic graphic_figure graphicRef82793 \" href=\"mobipreview.htm?3/48/3841\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      In developmental dysplasia of the hip, the &ldquo;socket&rdquo; part of the joint doesn&rsquo;t form normally. Because of this, the hip joint is too loose. The &ldquo;ball&rdquo; part can slip out of the joint too easily. If it slips completely out of the joint, doctors call it &ldquo;dislocation.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H265788875\">",
"      <span class=\"h1\">",
"       What are the symptoms of developmental dysplasia of the hip?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Developmental dysplasia of the hip usually causes no symptoms in babies. People usually find out their baby has it during a routine exam. All babies are checked for developmental dysplasia of the hip after birth. Plus, doctors and nurses check for this condition at every routine visit until a child is walking.",
"     </p>",
"     <p>",
"      Sometimes, people find out their child has developmental dysplasia of the hip when their child has an X-ray of the hip done for another reason.",
"     </p>",
"     <p>",
"      In toddlers and older children, development dysplasia of the hip can cause symptoms. It can make 1 leg look shorter or turned away from the body. It can also cause a child to limp or walk in an uneven way.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H265788890\">",
"      <span class=\"h1\">",
"       Is there a test for developmental dysplasia of the hip?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The doctor or nurse will check for this condition by moving your baby&rsquo;s legs around in the hip joint. He or she will also check to make sure that both legs look the same, and that 1 leg does not seem shorter than the other.",
"     </p>",
"     <p>",
"      The doctor or nurse might also order an X-ray or imaging test. The test done most often to check for developmental dysplasia of the hip is an imaging test called an ultrasound. Imaging tests create pictures of the inside of the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H265788905\">",
"      <span class=\"h1\">",
"       How is developmental dysplasia of the hip treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends mostly on your child&rsquo;s age.",
"     </p>",
"     <p>",
"      Babies younger than 2 weeks old aren&rsquo;t always treated right away. That&rsquo;s because a loose hip joint can be normal in newborn babies. It sometimes gets better on its own. If your baby has a loose hip, the doctor or nurse will keep checking it to see if the condition goes away or lasts.",
"     </p>",
"     <p>",
"      Treatment for babies ages 2 weeks to 6 months usually involves wearing a device to hold the hip joint in place so that the bones can grow normally. The device most often used is called a &ldquo;Pavlik harness&rdquo; (",
"      <a class=\"graphic graphic_figure graphicRef83482 \" href=\"mobipreview.htm?27/0/27663\">",
"       figure 2",
"      </a>",
"      ). Babies usually need to wear this for 2 to 3 months.",
"     </p>",
"     <p>",
"      Treatment for babies and children older than 6 months usually involves a procedure or surgery to put the hip joint bones back in the correct position. Then your child will need to wear a cast for 3 to 4 months to keep the hip joint in place.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H265788920\">",
"      <span class=\"h1\">",
"       Does developmental dysplasia of the hip cause long-term problems?",
"      </span>",
"      &nbsp;&mdash;&nbsp;This depends on different factors, including how old your child was when the condition was found and how severe it was. Many babies with this condition have no long-term hip problems.",
"     </p>",
"     <p>",
"      Some children, especially those who were found to have the condition later in childhood, have hip joint pain or damage later on.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H265788935\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?30/31/31218?source=see_link\">",
"       Patient information: Newborn appearance (The Basics)",
"      </a>",
"     </p>",
