"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"mobipreview.htm?32/27/33205?source=see_link\">",
"    see \"Vitamin C (ascorbic acid): Patient drug information\"",
"   </a>",
"   and",
"   <a class=\"drug drug_pediatric\" href=\"mobipreview.htm?8/18/8485?source=see_link\">",
"    see \"Vitamin C (ascorbic acid): Pediatric drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"mobipreview.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F136900\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Acerola [OTC];",
"     </li>",
"     <li>",
