"     </li>",
"     <li>",
"      Asco-Tabs-1000 [OTC];",
"     </li>",
"     <li>",
"      Ascocid&reg; [OTC];",
"     </li>",
"     <li>",
"      Ascocid&reg;-500 [OTC];",
"     </li>",
"     <li>",
"      C-Gel [OTC];",
