"   <div class=\"block pha drugH1Div\" id=\"F136870\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Not fully understood; necessary for collagen formation and tissue repair; involved in some oxidation-reduction reactions as well as other metabolic pathways, such as synthesis of carnitine, steroids, and catecholamines and conversion of folic acid to folinic acid",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F136888\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Readily absorbed; an active process thought to be dose dependent",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Large",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via oxidation and sulfation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (with high blood levels)",
"    </p>",
"   </div>",
