" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Longitudinal relaxation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 321px; height: 199px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Evolution of magnetization after a 180&deg; radiofrequency excitation. Magnetization is flipped 180&deg; at time zero (t=0). Magnetization relaxes toward equilibrium as energy is lost. Magnetization recovery is 63 percent complete at time t=T1 and 100 percent complete at time t&gt;&gt;T1.",
