var title_f37_45_38621="AV nodal conduction in EAVNC";
var content_f37_45_38621=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F63880&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F63880&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Patterns of AV nodal conduction in EAVNC",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 386px; height: 280px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The atrial to His (A-H) interval, which represents atrioventricular (AV) nodal conduction time, is plotted against the pacing cycle length or A1-A2 interval. The normal response is a progressive lengthening of the AH interval with a shorter pacing cycle length (ie, faster heart rate), a phenomenon known as decremental conduction. In patients with enhanced AV nodal conduction (EAVNC), four patterns of response are seen. Type I represents reduced AH interval prolongation in response to atrial pacing; type II shows an initial increase in the AH interval followed by a plateau and then a further increase in the AH interval with faster pacing rates; type III reveals no change in AH interval in response to increasing atrial pacing rates; type IV represents no change in AH interval until the pacing cycle lengths are very short, thereby resulting in marked AH prolongation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f37_45_38621=[""].join("\n");
