"     <tr>",
"      <td class=\"subtitle1_single\" colspan=\"2\">",
"       High-fiber diet guidelines from Texas Children's Hospital",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"2\">",
"       Read labels on foods, and look for 3 or more grams of fiber per serving. Eat 3 or more servings each day of breads and cereals made from whole grains and bran. Eat 5 or more servings each day of fruits and vegetables, including beans. It is important to increase water in the diet when you increase fiber.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"2\">",
"       Meat, poultry, fish, milk, milk products, and fats such as oil, margarine, and salad dressings do not normally have fiber, but it is important to include these in your child's diet to provide a complete balance of foods.",
"      </td>",
"     </tr>",
